import React, { Components } from 'react';
import {BrowserRouter as Router, Switch, Route, Link} from "react-router-dom";

function Navigation(){
    return(
    <Router>
      <div>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
          <li>
            <Link to="/about">About</Link>
          </li>
          <li>
            <Link to="/dashboard">Dashboard</Link>
          </li>
        </ul>
      </div>
    </Router>
      )

    
}

export default Navigation;
